import React, { Component ,Suspense } from 'react'
import { Switch ,Route} from 'react-router-dom'
import login from './login'



export default class App extends Component {
  render() {
    return (
      <div className='App'>

        <Switch>
          <Route exact path= '/' component={login}></Route>
        </Switch>


      </div>
    )
  }
}
